import { TextStyle, Page, Layout } from '@shopify/polaris';

const index = () => {
  return (
    <Page>
      <Layout>
        <TextStyle variation='positive'>
          <p>Text from koa shopify</p>
        </TextStyle>
      </Layout>
    </Page>
  );
};
export default index;
